import { useEffect } from 'react'
import axios from 'axios'

import Card from '../ui/Card';
import MealItem from './mealItems/MealItem';
import classes from './AvailableMeals.module.css';
import DUMMY_MEALS from '../../assets/dummy-meals'
// const postHandler = () => {
//   axios.get('https://saga-quick-attempt-default-rtdb.firebaseio.com/')
// }

function AvailableMeals() {
  useEffect(() => {
    const fetchMeals = async () => {
      const response = axios.get('https://saga-quick-attempt-default-rtdb.firebaseio.com/meals.json')
      if (!response.ok) {
        throw new Error('Something went wrong!');
      }
      const responseData = await response.json();
      console.log("Resp: ")
      console.log(JSON.stringify(responseData))
    }
    // const response = fetch(
    //   'https://saga-quick-attempt-default-rtdb.firebaseio.com/meals.json'
    // );
    console.log("Resp: " + response.json)
  }, []);

  const mealsList = DUMMY_MEALS.map((item) =>
    <MealItem
      key={item.id}
      id={item.id}
      name={item.name}
      description={item.description}
      price={item.price}
    />
  )

  return (
    <div>
      <section className={classes.meals}>
        <Card>
          <ul>{mealsList}</ul>
        </Card>
      </section>
    </div>
  )
}

export default AvailableMeals
